import React from 'react';

import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';



const TableGame = () => {

    const StyledTableCell = withStyles((theme) => ({
        head: {
            backgroundColor: theme.palette.common.white,

        },
        body: {
            fontSize: 14,
        },
    }))(TableCell);

    const StyledTableRow = withStyles((theme) => ({
        root: {
            '&:nth-of-type(odd)': {
                backgroundColor: theme.palette.action.hover,
            },
        },
    }))(TableRow);

    function createData(name, calories, fat, carbs, protein) {
        return { name, calories, fat, carbs, protein };
    }


    const useStyles = makeStyles({
        table: {
            minWidth: 700,
        },
    });
    document.title = "Table Game"

    return (
        <>

            <TableContainer component={Paper} style={{ marginTop: "100px", marginBottom: "50px" }}>
                <Table className="table" aria-label="customized table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Actions</StyledTableCell>
                            <StyledTableCell>Name</StyledTableCell>
                            <StyledTableCell align="right">Genre</StyledTableCell>
                            <StyledTableCell align="right">SinglePlayer</StyledTableCell>
                            <StyledTableCell align="right">Multiplayer</StyledTableCell>
                            <StyledTableCell align="right">Platform</StyledTableCell>
                            <StyledTableCell align="right">Release</StyledTableCell>
                            <StyledTableCell align="right">Image_URL</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>

                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                        <StyledTableCell align="right">w</StyledTableCell>
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    )
}
export default TableGame;
